import junit.framework.TestCase;

public class SubComponentTest_10805 extends TestCase {
	
	public void testSequenceFeature() throws SBOLGraphException, IOException, Exception
    {
		String baseUri="https://sbolstandard.org/examples/";
        SBOLDocument doc=new SBOLDocument(URI.create(baseUri));
 

        
        String gfp_na="";
		Component gfp=SBOLAPI.createDnaComponent(doc, "E0040", "E0040", null, Role.CDS, gfp_na);
		Sequence seq= gfp.getSequences().get(0);
		
		//String region_na = "";
		String region_na = "taaagttttcactggaattcttgttgaattagatggt";
		Component region=SBOLAPI.createDnaComponent(doc, "region", "region", "region", Role.EngineeredRegion,region_na);
		SubComponent feature=gfp.createSubComponent(region);
		feature.setOrientation(Orientation.inline);
		
		
		TestUtil.validateIdentified(feature,doc,0);

	    feature.createCut(3, seq);
	    feature.createRange(6, 10, seq);
	       
	    feature.createCut(12, seq);
	    feature.createCut(13, seq);
	    feature.createRange(20, 30, seq);
	    feature.createRange(40, 60, seq);
	    TestUtil.validateIdentified(feature,doc,0);
	 
	    //Overlapping range (10805) and the sequence range sum do not match the sequence length (100807):
	    feature.createRange(60, 61, seq);
	    TestUtil.validateIdentified(feature,doc,2);
	   
	    feature.createRange(16, 20, seq);
	    feature.createRange(7, 8, seq);
	    TestUtil.validateIdentified(feature,doc,4); 
	    
    }

}
